import Home from "./pages/home/Home";
import BookSpace from "./pages/bookSpace/BookSpace";
import Vision from "./pages/vision/Vision";
import Services from "./pages/services/Services";

function App() {
  return (
      <Router>
        {/*<NavBar/>*/}
        <Routes>
            <Route path='/' element={<Home/>} />
